variable {α : Type}
variable {d : α → α → ℝ}

def isConnected (X : Set α) : Prop :=
  ∀ x ∈ X, ∀ y ∈ X, x ≠ y → d x y = 0

def isMetric (X : Set α) : Prop :=
  (∀ x ∈ X, ∀ y ∈ X, x ≠ y → d x y ≥ 0) ∧
  (∀ x ∈ X, ∀ y ∈ X, ∀ z ∈ X, x ≠ y ∧ y ≠ z ∧ z ≠ x → d x y + d y z = d x z)

def isUncountable (X : Set α) : Prop :=
  Set.Infinite X ∨ ∃ A : Set α, A ⊆ X ∧ ¬Set.Countable A

